import React from 'react';

export const Header = () => {
  const ul = {
     
        listStyleType: "none",
        margin: 0,
        padding: 0,
        overflow: "hidden",
        backgroundColor: "#333",
        marginBottom:"20px",
        padding: "14px 16px"
      }
      
      const li = {
        marginRight:"50px",
        float: "left"
      }
      
     
        return (
            <ul style={ul}>
                <li style={li}>Files</li>
                <li>new File</li>
            </ul>
        )
}
